func reverse(s string) string{
	var res string
	res = ""
	for i := len(s)-1; i >= 0; i--{
		res += string(s[i])
	}
	return  res
}

func min(a int, b int) int{
	if a < b{
		return a
	}
	return  b
}

func shortestPalindrome(s string) string {
	l := len(s)
	minStr := s + s
	for i := 0; i < l; i++ {
		fmt.Println(i, l)
		if i <= (l / 2) {
			if s[0:i] == "" || s[0:i] == reverse(s[i+1:min(2*i+1, l)]){
				tmp := reverse(s[i+1:min(2*i+1, l)]) + string(s[i]) + s[i+1:min(2*i+1,l)]
				if len(tmp) < len(minStr) {
					minStr = tmp
				}
			}
			if i != l / 2 && s[0:i+1] == reverse(s[i+1:2*i+2]){
				tmp := reverse(s[i+1:l]) + s[i+1:l]
				if len(tmp) < len(minStr){
					minStr = tmp
				}
			}
		}
	}
	return minStr
}

func main(){
	tmp := ""
	fmt.Println(shortestPalindrome(tmp))
}